function RunAndSave(city, bldg)

    # Loop through scenarios for each building type
    scen_objs = ["_b_", "_br_", "_brch_"] ## "_b_", , "_brch_"

    # For each objective
    for obj in scen_objs

        # Run BAU and Techs case
        bau_file = "$city $bldg$obj"*"bau"
        techs_file = "$city $bldg$obj"*"techs"

        # Results file savename
        savename = bau_file[1:end-4]

        print("$savename \n")

        # Run optimizations (BAU and Investment Case)
        m = Model(CPLEX.Optimizer)
        results_bau = run_reopt(m, "/Users/amandafarthing1/.julia/dev/REoptLite/test/scenarios/Ann_Arbor/$bau_file.json")

        m = Model(CPLEX.Optimizer)
        results_techs = run_reopt(m, "/Users/amandafarthing1/.julia/dev/REoptLite/test/scenarios/Ann_Arbor/$techs_file.json")

        # Save results to csv
        savelist = [
          ## Select inputs
          "cost_ton_CO2",
          #"cost_ton_NOx",
          #"cost_ton_SO2",
          "outage_durations", "outage_start_timesteps",
          "dvUnservedLoad",
          "TOU_demand_rates",
          "monthly_demand_rates",

          ## System sizes
          "PV_kw", "batt_kw", "batt_kwh",

          ## Other results
          "year_one_utility_kwh",
          "year_one_bill",
          "unserved_load_per_outage",

          ## LCC and sub-components
          "lcc",
          "net_capital_costs_plus_om",
          # "gen_total_fuel_cost",
          "total_energy_cost",
          "total_demand_cost",
          "total_fixed_cost",
          "total_min_charge_adder",
          "total_export_benefit",
          "TotalCO2Cost",
          "TotalHealthCost",
          ## Outage-related costs in the objective
          "expected_outage_cost",
          "mgTotalTechUpgradeCost",
          "dvMGStorageUpgradeCost"
          # "ExpectedMGFuelCost"
        ]

        # Save results in dataframe
        d = Dict("vars"=>[key for key in savelist],
              "bau"=>[results_bau[key] for key in savelist],
              "techs"=>[results_techs[key] for key in savelist]
        )
        df = DataFrame(d)

        # Create NPV column (for lcc costs)
        df[!,"npv"] = df[!,"bau"] - df[!,"techs"]

        # Write results to csv
        CSV.write("/Volumes/GoogleDrive/My Drive/0_Michigan/Master's Thesis/Results/Ann_Arbor/$savename.csv", df) # $savename (file name)

        # Time series results to save, for techs case
        d = Dict("net_load_techs"=>results_techs["net_load"],
                  "building_load"=>results_techs["building_load"],
                  "energy_rates"=>results_techs["energy_rates"],
                  "export_rates_NEM"=>results_techs["export_rates"][:NEM],
                  "export_rates_WHL"=>results_techs["export_rates"][:WHL],

        )
        df2 = DataFrame(d)

        # Write 8760 results to csv
        CSV.write("/Volumes/GoogleDrive/My Drive/0_Michigan/Master's Thesis/Results/Ann_Arbor/$savename 8760.csv", df2) # $savename (file name)

    end

end

